  `carauthenticationState` int(1) DEFAULT NULL COMMENT '认证状态(0和null 为未认证中，1：认证成功 2：认证失败3 审核) ',
  `carauthenticationTime` datetime DEFAULT NULL COMMENT '认证时间',
  PRIMARY KEY (`carauthenticationId`),
  KEY `FK_carauthentication_CarInfo` (`carId`),
