  CONSTRAINT `FK_carauthentication_CarInfo` FOREIGN KEY (`carId`) REFERENCES `carinfo` (`carId`),
  CONSTRAINT `FK_carauthentication_useinfo` FOREIGN KEY (`userid`) REFERENCES `userinfo` (`userid`)
