  `userid` varchar(36) NOT NULL COMMENT '用户外键(谁收藏的)',
  `identifying` varchar(36) NOT NULL COMMENT '收藏标识（一般与车位类型匹配，比如：车位类型为公共停车场，那么该数据就为公共停车场的主键，是私人停车位。那就是私人停车位的车位主键）',
