  `housId` varchar(36) DEFAULT NULL COMMENT '小区外键(对应小区)',
  `detailedAddress` varchar(300) NOT NULL COMMENT '入口详细地址',
  `housType` varchar(50) NOT NULL COMMENT '车位类型(地面；室内；充电桩)',
