  `orderType` int(1) DEFAULT NULL COMMENT '订单类型(0:公共停车场1 ：私人车位）',
  `placeorde_time` datetime DEFAULT NULL COMMENT '下订单时间（生成时间）',
  `supplierconfirm_time` datetime DEFAULT NULL COMMENT '供方确认时间',
  `payment_time` datetime DEFAULT NULL COMMENT '支付时间',
  `payType` int(1) DEFAULT NULL COMMENT '支付方式（0：未支付 ，1：支付宝 2：微信 3:余额）',
  `order_state` int(1) DEFAULT NULL COMMENT '订单状态(0:等待中，1:已完成 2：已拒绝)',
  `carNo` varchar(50) DEFAULT NULL COMMENT '车牌号(生成订单，将车牌号赋值于该字段)',
