  `userid` varchar(36) NOT NULL,
  PRIMARY KEY (`orderId`,`orderNum`),
  UNIQUE KEY `UN_OrderInfo_orderNum` (`orderNum`),
  KEY `FK_OrderInfo_UserInfo` (`userid`),
