-- ----------------------------
-- Table structure for park
-- ----------------------------
DROP TABLE IF EXISTS `park`;
CREATE TABLE `park` (
  `parkId` varchar(36) NOT NULL COMMENT '主键',
  `parkName` varchar(200) DEFAULT NULL COMMENT '停车场/小区名字',
  `parkAddress` varchar(300) DEFAULT NULL COMMENT '停车场/小区地址',
  `parkbusinessType` varchar(20) DEFAULT NULL COMMENT '停车场/小区商业类型(办公，居住，商城 等)',
  `entryAddress` varchar(300) DEFAULT NULL COMMENT '入口地址',
  `location_x` varchar(20) DEFAULT NULL COMMENT '位置经度',
  `location_y` varchar(20) DEFAULT NULL COMMENT '位置维度',
  `ispulic` int(1) DEFAULT NULL COMMENT '是否为公益停车场(0：不是 1：是)',
  `beBegin` datetime DEFAULT NULL COMMENT '运营时间、开始',
  `beEnd` datetime DEFAULT NULL COMMENT '运营时间、结束',
  `parkSum` int(6) DEFAULT NULL COMMENT '停车位总数',
  `parkType` varchar(20) DEFAULT NULL COMMENT '停车位类型(地面，室内，。。)',
  `automaticOrder` int(1) DEFAULT NULL COMMENT '保安自动接单(0:和null 为手动接单  1：自动接单)',
  `parkprice` double(8,2) DEFAULT NULL COMMENT '停车价格',
  `chargeType` int(1) DEFAULT NULL COMMENT '普通收费类型(0：按次收费   1:按小时收费)',
  `reservationfee` double(8,2) DEFAULT NULL COMMENT '预约费',
  `reservationfeedivide` double(5,2) DEFAULT NULL COMMENT '预约费分成(给停车场百分之多少)',
  `parkingisdivided` double(5,2) DEFAULT NULL COMMENT '停车费分成(给停车场百分之多少的分成)',
  `cash` double(6,2) DEFAULT NULL COMMENT '首小小时保证金',
  `iswhether` int(1) DEFAULT NULL COMMENT '是否合作(0:不合作；1：合作)',
  `gaodeId` varchar(10) DEFAULT NULL COMMENT '高德地图Id',
  `partner` varchar(10) DEFAULT NULL COMMENT '第三方合作伙伴（比如hexie）',
  `userid` varchar(36) DEFAULT NULL COMMENT '谁添加的小区（不添加外键  可以为空）',
  `createtime` datetime DEFAULT NULL,
  `parkstate` int(1) DEFAULT NULL COMMENT '停车场状态(0:可预约 1：不可预约2:免预约 )',
  `feeModel` varchar(800) DEFAULT NULL COMMENT '收费模式',
  `Monthly` varchar(255) DEFAULT NULL,
  `shouldstop` varchar(36) DEFAULT NULL,
  `parkpicture` varchar(255) DEFAULT NULL COMMENT '停车场图片',
  PRIMARY KEY (`parkId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='小区停车场表';

-- ----------------------------
-- Records of park
