-- ----------------------------
-- Table structure for parkcharge
-- ----------------------------
DROP TABLE IF EXISTS `parkcharge`;
CREATE TABLE `parkcharge` (
  `parkcharge` varchar(36) NOT NULL,
  `carNo` varchar(50) NOT NULL COMMENT '车牌(开始计时的车牌号码)',
  `receivableMoney` double(8,2) DEFAULT NULL COMMENT '应收价格',
  `practicalMoney` double(8,2) DEFAULT NULL COMMENT '实际价格',
  `parkId` varchar(36) DEFAULT NULL COMMENT '停车场外键（计费对应哪个停车场）',
  `chargeUserId` varchar(36) DEFAULT NULL COMMENT '收费用户外键',
  `beginTime` datetime DEFAULT NULL COMMENT '开始计时时间（车进去的时间）',
  `endTime` datetime DEFAULT NULL COMMENT '结束计时时间（车出来的时间）',
  `payState` int(1) DEFAULT NULL COMMENT '支付状态（0：未支付 1：已经支付）',
  `online` int(1) DEFAULT NULL COMMENT '线上线下',
  `payidentifying` varchar(20) DEFAULT NULL COMMENT '支付标识(用于支付参数 根据当前参数来修改支付状态)',
  `payType` int(1) DEFAULT NULL COMMENT '支付类型(1:支付宝2：微信3：余额)',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `payMoney` double(8,2) DEFAULT NULL COMMENT '支付金额(支付金额，存储用户支付的金额。。避免重复支付)',
  `userid` varchar(36) NOT NULL COMMENT '用户外键',
  PRIMARY KEY (`parkcharge`),
  KEY `FK_parkcharge_park` (`parkId`),
  KEY `FK_parkcharge_userinfo` (`userid`),
  CONSTRAINT `FK_parkcharge_park` FOREIGN KEY (`parkId`) REFERENCES `park` (`parkId`),
  CONSTRAINT `FK_parkcharge_userinfo` FOREIGN KEY (`userid`) REFERENCES `userinfo` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车收费记录表';

-- ----------------------------
-- Records of parkcharge
-- ----------------------------

-- ----------------------------
-- Table structure for parkcooperation
-- ----------------------------
DROP TABLE IF EXISTS `parkcooperation`;
CREATE TABLE `parkcooperation` (
  `pcId` varchar(36) NOT NULL,
  `housId` varchar(36) DEFAULT NULL COMMENT '小区外键',
  `contactName` varchar(50) NOT NULL,
  `phone` varchar(11) NOT NULL,
  `entrance` varchar(200) DEFAULT NULL COMMENT '入口',
  `type` varchar(30) DEFAULT NULL COMMENT '类型',
  `money` double(8,2) DEFAULT NULL COMMENT '收费',
  `beginTime` time DEFAULT NULL COMMENT '运营开始时间',
  `endTime` time DEFAULT NULL COMMENT '运营结束时间',
  `cooperationintention` int(1) DEFAULT NULL COMMENT '合作意向(1:免费上线，2：关联物业 3：关联保安)',
  `feeType` int(1) DEFAULT NULL COMMENT '收费类型(1:次  2：小时)',
  PRIMARY KEY (`pcId`),
  KEY `FK_ParkCooperation_House` (`housId`),
  CONSTRAINT `FK_ParkCooperation_House` FOREIGN KEY (`housId`) REFERENCES `hous` (`housId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='停车场合作';

-- ----------------------------
-- Records of parkcooperation
