DROP TABLE IF EXISTS `parkorderdetails`;
CREATE TABLE `parkorderdetails` (
  `porderId` varchar(36) NOT NULL COMMENT '主键',
  `parkId` varchar(36) NOT NULL COMMENT '停车场外键(对应公共停车场)',
  `beginTime` datetime NOT NULL COMMENT '开始时间',
  `endTime` datetime NOT NULL COMMENT '结束时间',
  `reservationfee` double(6,2) NOT NULL COMMENT '预约费(数据来自停车场表)',
  `cash` double(6,2) NOT NULL COMMENT '首小时保证金（数据来自停车场表）',
  `thankFee` double(6,2) DEFAULT NULL COMMENT '感谢费',
  `orderId` varchar(36) NOT NULL COMMENT '订单外键',
  `evaluation` int(1) DEFAULT NULL COMMENT '评价',
  PRIMARY KEY (`porderId`),
  KEY `FK_ParkOrderDetails_Order` (`orderId`),
  KEY `FK_ParkOrderDetails_ParkInfo` (`parkId`),
  CONSTRAINT `FK_ParkOrderDetails_Order` FOREIGN KEY (`orderId`) REFERENCES `orderinfo` (`orderId`),
  CONSTRAINT `FK_ParkOrderDetails_ParkInfo` FOREIGN KEY (`parkId`) REFERENCES `park` (`parkId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='公共停车场订单详情表';

-- ----------------------------
-- Records of parkorderdetails
