  `receiveTime` datetime NOT NULL COMMENT '领取时间',
  `duetime` datetime DEFAULT NULL COMMENT '到期时间',
  `isUse` int(1) DEFAULT NULL COMMENT '是否已经使用( 0：未使用 ：1：已经使用)',
  PRIMARY KEY (`receiveId`),
  KEY `FK_receiveRedPacket_shareRedPacket` (`shareId`),
  KEY `FK_receiveRedPacket_userInfo` (`userid`),
  CONSTRAINT `FK_receiveRedPacket_shareRedPacket` FOREIGN KEY (`shareId`) REFERENCES `shareredpacket` (`shareId`),
  CONSTRAINT `FK_receiveRedPacket_userInfo` FOREIGN KEY (`userid`) REFERENCES `userinfo` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='红包领取表';

