-- ----------------------------
-- Table structure for transactionrecord
-- ----------------------------
DROP TABLE IF EXISTS `transactionrecord`;
CREATE TABLE `transactionrecord` (
  `trId` varchar(36) NOT NULL,
  `userid` varchar(36) DEFAULT NULL COMMENT '用户外键',
  `tradeType` varchar(10) NOT NULL COMMENT '交易类型(1:订单收益，2：余额支付，3：退款金额  ,4:支付宝支付,5:微信支付，6...待定)',
  `tradeMoney` double(8,2) NOT NULL COMMENT '交易金额(负数就是支出，正数就是收益 不能为0)',
  `tradeTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '交易时间',
  `recordstate` int(1) DEFAULT NULL COMMENT '记录状态(0和null 代表未删除  1 代表删除和失效)',
  PRIMARY KEY (`trId`),
  KEY `FK_transactionRecord_userinfo` (`userid`),
  CONSTRAINT `FK_transactionRecord_userinfo` FOREIGN KEY (`userid`) REFERENCES `userinfo` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易记录表';

-- ----------------------------
-- Records of transactionrecord
-- ----------------------------

-- ----------------------------
-- Table structure for userinfo
-- ----------------------------
DROP TABLE IF EXISTS `userinfo`;
CREATE TABLE `userinfo` (
  `userid` varchar(36) NOT NULL COMMENT '用户主键',
  `name` varchar(100) DEFAULT NULL COMMENT '用户姓名',
  `password` varchar(100) DEFAULT NULL COMMENT '用户密码',
  `phone` varchar(11) NOT NULL COMMENT '手机号',
  `sex` int(1) DEFAULT NULL COMMENT '性别（0:未填写 1：男 2：女）',
  `age` int(2) DEFAULT NULL COMMENT '年龄段（-1  代表老人家  ，0：00后 10：代表10后 80：代表80后  90： 代表90后）',
  `headportrait` varchar(500) DEFAULT NULL COMMENT '头像',
  `regid` varchar(50) DEFAULT NULL COMMENT '推送id',
  `beenDriv` int(1) DEFAULT NULL COMMENT '驾龄：（0：未填写  1：一年。。5:五年  ,6  ：老司机 ）',
  `signature` varchar(200) DEFAULT NULL COMMENT '个性签名',
  `valToken` varchar(36) DEFAULT NULL COMMENT '登陆有效验证  每次打开app验证登陆是否有效',
  `invitecode` varchar(20) DEFAULT NULL COMMENT '用户注册随机生成的一串码',
  `payNo` varchar(100) DEFAULT NULL COMMENT '普通用户用于提现使用(支付宝账户)',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '账户名称(银行卡开户姓名，用于保安提现使用)',
  `bank_no` varchar(50) DEFAULT NULL COMMENT '银行卡账号（保安用于提现使用）',
  `bank_type` varchar(100) DEFAULT NULL COMMENT '开户银行  如：（南京银行）用于保安提现使用',
  `bank_open_address` varchar(200) DEFAULT NULL COMMENT '开户地区（用于保安提现使用）',
  `bank_open_branch` varchar(200) DEFAULT NULL COMMENT '开户支行(用户保安提现使用)',
  `regCode` varchar(6) DEFAULT NULL,
  `retrievePwdSmsCode` varchar(6) DEFAULT NULL,
  `regDate` datetime DEFAULT NULL,
  `parkid` varchar(36) DEFAULT NULL COMMENT '关联停车场(如果当前用户是保安物业收费员等，该字段用于绑定该用户属于哪个停车场)',
  `securityState` int(1) DEFAULT NULL COMMENT '保安状态(保安状态  0 和null 下线  1：上线 )',
  `lastLoginTime` datetime DEFAULT NULL COMMENT '最后一次登录时间，在验证token时候修改',
  `tokenValidTime` datetime DEFAULT NULL COMMENT 'token到期时间',
  `regCodeTime` datetime DEFAULT NULL COMMENT '注册发送验证码时间',
  `retrievePwdSmsCodeTime` datetime DEFAULT NULL COMMENT '找回，密码发送验证码时间',
  `reactivetime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '用户活跃时间',
  PRIMARY KEY (`userid`),
  UNIQUE KEY `un_phone` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of userinfo
-- ----------------------------

